import React from 'react'
const inutField = () => {
    return (
        <div>
            <FormGroup>
                <Label for="titleId">Title</Label>
                <Input type="text" name="title" id="exampleEmail" placeholder="EG Wow nature ..." />
            </FormGroup>
        </div>
    );
}

export default inutField;
